import React from "react";
import { CoreTeamDetails } from "./CoreTeamDetails";

const CoreTeam = () => {
  return (
    <div>
      <div className="text-red-700 font-semibold text-center text-4xl pb-10">
        Core Team
      </div>

      <div>
        {CoreTeamDetails.map((member) => {
          return <Core member={member} />;
        })}
      </div>
    </div>
  );
};

export default CoreTeam;
